import apiConstants from "@/services/utils/constants";
import apiClient from "../config";

const endPointsApiClient = apiClient.create({
    baseURL: `${apiClient.defaults.baseURL}${apiConstants.endPoints.BASE_ROUTE}`,
    headers: {
        ...apiClient.defaults.headers,
    },
});

endPointsApiClient.interceptors.request.use(
    (config) => {
        const token = localStorage.getItem("endPoints_token");
        if (token) {
            config.headers["Authorization"] = `Bearer ${token}`;
        }
        console.log("Institute module request:", config);
        return config;
    },
    (error) => Promise.reject(error)
);

endPointsApiClient.interceptors.response.use(
    (response) => {
        console.log("Institute module response:", response);
        return response;
    },
    (error) => Promise.reject(error)
);

export default endPointsApiClient;
